import React from 'react';
import '../App.css';
import './Mail.css';


function Mail() {
  return (
    <div className='mail-container'>
    <h2>Hello World!</h2>
    console.log(Hello World!);
      <p>Are you interested in collaborating?</p>
      <p>Please send me an email or call me.</p> 
      <div className="row">
        <div className="column"><p><a href="mailto:michael@kelly.media" className='envelope'><i className="far fa-envelope fa-3x envelope"></i></a></p></div>
        <div className="column"><p><a href="tel:541-203-0711" className='phone'><i className="fas fa-mobile-alt fa-3x"></i></a></p></div>
      </div>
    </div>
  );
}

export default Mail;
